[gcode_macro DISABLE_STEPPERS]
gcode:
  SET_STEPPER_ENABLE STEPPER=extruder ENABLE=0
  SET_STEPPER_ENABLE STEPPER=stepper_x ENABLE=0
  SET_STEPPER_ENABLE STEPPER=stepper_y ENABLE=0
  SET_STEPPER_ENABLE STEPPER=stepper_z ENABLE=0

######################################################################
# Start Macro
######################################################################

[gcode_macro START_PRINT]
gcode:
    {% set BED_TEMP = params.BED_TEMP|default(60)|int %}
    {% set EXTRUDER_TEMP = params.EXTRUDER_TEMP|default(200)|int %}

    M117 Starting Print...
    G90                          ; Absolute positioning
    M83                          ; Extruder relative mode
    M140 S{BED_TEMP}            ; Set bed temp (no wait)
    M104 S150                   ; Preheat nozzle to 150°C to reduce oozing
    G4 S10                      ; Wait 10s for partial warmup
    G28                         ; Home all axes
    G1 Z50 F240                 ; Raise Z for clearance
    M190 S{BED_TEMP}            ; Wait for bed to reach temp
    G28 Z                       ; Re-home Z to account for thermal expansion
    Z_TILT_ADJUST               ; Perform Z tilt adjustment (if supported)
    G28 Z                       ; Re-home Z again after tilt adjust
    BED_MESH_CLEAR              ; Clear previous mesh
    BED_MESH_CALIBRATE          ; Run full mesh calibration
    CARTOGRAPHER_TOUCH          ; Run Cartographer touch probe routine
    M104 S{EXTRUDER_TEMP}       ; Set final nozzle temp
    M109 S{EXTRUDER_TEMP}       ; Wait for nozzle to reach temp
    G92 E0                      ; Reset extruder
    G1 Z0.28 F240               ; Move to prime height
    G1 X2 Y10 F3000             ; Move to front-left
    G1 Y140 E10 F1500           ; Prime line 1
    G1 X2.3 F5000               ; Quick move to reset position
    G92 E0                      ; Reset extruder again
    G1 Y10 E10 F1200            ; Prime line 2
    G92 E0                      ; Final extruder reset
    M117 Printing...

